import React from "react";
import { Link } from "react-router-dom";

const NavBar = props => {
  return (
    <nav className="nav-wrapper amber darken-1">
      <div className="container">
        <Link to="/" className="brand-logo">
          Hangry
        </Link>
      </div>
    </nav>
  );
};

export default NavBar;
